INSERT INTO `contact_requests` VALUES (1,'sophie','sophie.mrbtc@gmail.com','Hi,\r\nPlease add us under your partners section\r\nTarget URL - https://mrbtc.org/\r\nLogo - Please find the attachment for the Logo\r\n\r\nIn return, i can add your press releases or any content related to crypto, blockchain, etc with do-follow backlinks on my other site - https://mrcrypto.cc/\r\n\r\nLet me know if you have any questions.\r\nThanks in advance.','Business &amp; Sales','2019-06-13 06:56:02'),(2,'Andres Solanot','andres@figment.network','Hello,\r\n\r\nWe are starting to encounter more customers who are looking for custody solutions as they acquire PoS based tokens and looking to delegate with Figment. \r\n\r\nWe are in the process of  looking for a custody partner who could custody our client&#039;s tokens who would then delegate to Figment.  Is this something you might be able to help us with?   All tokens would be some form of PoS or DPoS.\r\n\r\nWarmly,\r\nAndr&eacute;s Solanot','Business &amp; Sales','2019-06-13 17:47:53'),(3,'Steve Jones','Steve@elsner.com','Hello,\r\n\r\nHope you&#039;re doing good!\r\n\r\nI&#039;M Steve Jones, Senior Business Consultant.\r\n\r\nWe have 12+ years of experience in serving clients globally, our vision is delivering solutions to our business associates, assisting them with their growth in both Digital Marketing as well as Development in various Technologies.\r\nIt would be great if you can provide time for a short call, where we can discuss the business synergies and look forward to long term relationship.  \r\n\r\nLooking forward to hearing from you soon.\r\n\r\nWith Gratitude,\r\nSteve Jones','Business &amp; Sales','2019-06-25 06:07:08'),(4,'Felix Ihah','fsihah25@gmail.com','I am looking for investment for my business Hotels Tourism Media Ltd promoting marketing advertising company for Africa Tourism Destination overseas Beased in the UK happy to relocate \r\n\r\nLooking for &pound;750,000.00 for 30% stack on my business. https://www.hotelstourismmedia.com/so/93MQyQKwH#/main join us to Reach and Inspire Africa Tourism Destination by Limelight Gateway to Africa\r\n\r\nMore information can be found in the link above.\r\nYours faithfully\r\nFelix Ihah\r\nMarketing Director\r\nhttps://www.safariafrica.biz/so/8M82mSN-?cid=4805e958-3936-4da3-bed6-329a1eb4b96c#/main \r\nJoin us to Reach and Inspire Africa Tourism Destination by Limelight Gateway to Africa','Business &amp; Sales','2019-06-26 23:38:04'),(5,'Felix Ihah','fsihah25@gmail.com','I am looking for investment for my business Hotels Tourism Media Ltd promoting marketing advertising company for Africa Tourism Destination overseas Beased in the UK happy to relocate \r\n\r\nLooking for &pound;750,000.00 for 30% stack on my business. https://www.hotelstourismmedia.com/so/93MQyQKwH#/main join us to Reach and Inspire Africa Tourism Destination by Limelight Gateway to Africa\r\n\r\nMore information can be found in the link above.\r\nYours faithfully\r\nFelix Ihah\r\nMarketing Director\r\nhttps://www.safariafrica.biz/so/8M82mSN-?cid=4805e958-3936-4da3-bed6-329a1eb4b96c#/main \r\nJoin us to Reach and Inspire Africa Tourism Destination by Limelight Gateway to Africa','Business &amp; Sales','2019-06-26 23:38:20'),(6,'Dan','dan.petrovic@koine.com','fbgblfgmbl;','Business &amp; Sales','2019-06-27 11:30:48'),(7,'Andres Solanot','andres@figment.network','Hello!\r\n\r\nI&#039;m wondering if you currently have any partnerships with token staking providers? The PoS sector is growing and we&#039;re seeing increased demand for both staking and custody of Proof of Stake assets. \r\n\r\nWould love to have the conversation. \r\n\r\nBest,\r\nAndr&eacute;s','Business &amp; Sales','2019-06-27 14:07:28'),(8,'Joe Lowe','joe.lowe@itworksrec.co.uk','NetSuite\r\n\r\nGood Afternoon,\r\n\r\nHope you had a good weekend?\r\n\r\nI understand Koine may have, or currently do use the ERP system NetSuite. I thought it&#039;d be worthwhile dropping you an email to see how your system is looking?\r\n\r\nI work with freelance NetSuite professionals across the UK so If you&#039;re ever looking for NetSuite support I&#039;d be more than happy to pick up an exploratory conversation.\r\n\r\nRegards,\r\nJoe\r\nNetSuite Contract Services Manager\r\n01772 278050','Business &amp; Sales','2019-07-01 14:32:54'),(9,'Sel&ccedil;uk Topal','selcuk.topal@yandex.com','Dear Sir/Madam,\r\n\r\nI am Associate Prof. Dr. Sel&ccedil;uk Topal.\r\n\r\nmy personal academic accounts:\r\nhttps://sites.google.com/view/selcuktopal/\r\nhttps://beu.academia.edu/Sel%C3%A7ukTopal\r\nhttps://www.linkedin.com/in/ph-d-sel%C3%A7uk-topal-80b39836/\r\n\r\nWe are looking for a partnership for our project having two android/ios apps (a game (HOX unblock puzzle) app and a social platform (Hugo App)).\r\n\r\nOur ERC20 HOX token circulates in these two apps. The game app will be released in around one week and we will have a game bounty campaign addition to facebook, twitter, etc. (on bitcointalk).\r\n\r\nOur app users will highly demand HOX tokens both earning, sending and exchanges. &nbsp;So we desire not only listing in exchange but also a partner for our project.\r\n\r\nWe are in ICO and we want our partners to purchase 6M-10M HOX tokens (demand for the apps).\r\n\r\n\r\nHOX UNBLOCK PUZZLE Game is ready in APPLE STORE&nbsp;https://apps.apple.com/tr/app/hox-unblock-puzzle-game/id1470616434?l=tr\r\nSincerely,\r\n\r\nOur Platforms /Channels\r\nhttps://hugoxytocin.io/\r\nhttps://hugoxytocin.io/doc/whitepaper.pdf\r\nhttps://twitter.com/hoxtoken\r\nhttps://www.facebook.com/hugoxytocin\r\nhttps://www.reddit.com/user/HoxToken\r\nhttps://www.linkedin.com/in/hox-token-4298a3189/\r\nhttps://github.com/hox-token\r\nhttps://medium.com/@HugoAPP\r\nhttps://youtu.be/uNgq9FttL7M\r\nIntro video for Hugo App: https://www.youtube.com/channel/UC-PgSM3c83Hzn6hBvP4W7gA\r\nHOX Unblock Puzzle Game: https://www.youtube.com/watch?v=Z2vBSTZd4aY','Business &amp; Sales','2019-07-01 15:38:23'),(10,'save','saverio.cianfrone@koine.com','TEST - It is often said that one day in crypto is the equivalent of a month in the traditional space. Having recently returned from a series of crypto related travels in the US, one can only be astonished by the pace of change in this nascent industry. Filtering through the conversations during my stay, there were two key points that consistently stood out:\r\n1- If somewhat painful, the &ldquo;Crypto Winter&rdquo; has now given way to an ecosystem which is increasingly institutional both in terms of its participants and projects.\r\n2 - The US and Asia, through the sheer size of their crypto activity, occupy centre stage when it comes to new developments in the crypto fund arena. In contrast, there appears to be a lack of awareness of the recent trends in Europe.\r\nThis second point is understandable and it&rsquo;s an opportunity to provide an overview of some of the current players and recent developments in the European Crypto Fund ecosystem.\r\nPainting the Landscape\r\nOver the past couple of years, there has been a global pick-up in the number of crypto fund launches. In 2018 alone, 20% of new hedge fund launches were crypto funds. Europe has been a slower mover however vs the US and Asia. Of the 700 Crypto funds currently in existence, approximately 15% are based in Europe[1].\r\nThese numbers don&rsquo;t tell the full picture however as the pace of new European Crypto fund launches has picked up significantly over the past few months. This is particularly true in London where new funds have been able to leverage the city&rsquo;s existing hedge fund infrastructure. Law firms are often the first port of call for new crypto managers looking to set-up and established names such as Eversheds and Simmons &amp; Simmons have now launched crypto fund services to assist new launches.\r\nThese new fund ventures are also benefiting from the innovation emerging from crypto centric providers looking to cater to the institutional market. The safe custody of digital assets has been one of the main headwinds to widespread institutional adoption in the space. On a crypto fund level, juggling cold storage vs the requirements of an active trading strategy has also been a challenge. However, significant progress has been made to address these hurdles as digital asset custodians, among which London based firms Copper and Koine, have rolled out innovative custody solutions to meet the requirements of active funds.','Business &amp; Sales','2019-07-01 16:05:44'),(11,'Julia Chevela','cco@certus.finance','Dear Sir or Madam, \r\n\r\nCould you kindly connect with me to arrange a meeting at BTC conference at Barcelona next week to discuss ideas for cooperation. Thank you in advance!\r\n\r\n--\r\nBest, \r\nJulia','Business &amp; Sales','2019-07-04 15:34:25'),(12,'Dan','dan.petrovic@koine.com','Hello, I love cycling\r\n\r\nJHECUWEGBCUWH\r\n\r\n\r\n\r\nsdfvndfjlvnldfj\r\n\r\n\r\n;kfjvkldfnv\r\n\r\n\r\nvnfejlvnldfjknv\r\n\r\nfjvbkjdbvn\r\n\r\n\r\n\r\nlefkvnkldfnvb','Business &amp; Sales','2019-07-04 17:37:53'),(13,'nick','nick.hurn@koine.com','test','Business &amp; Sales','2019-07-05 09:26:36'),(14,'Dan','dan.petrovic@koine.com','Campbell,\r\n\r\nPlease find attached our deck that details our service offering and for you to share with colleagues.\r\n\r\nI&rsquo;m off next week but looking forward to pursuing this with you upon my return. In my absence, please feel free to contact Dan (copied).\r\n\r\nMany thanks J\r\n\r\nFrom: Sara Khatib &lt;Sara.Khatib@koine.com&gt; \r\nSent: 04 July 2019 11:55\r\nTo: Campbell Adams &lt;campbell@puremarkets.co.uk&gt;\r\nCc: Dan Petrovic &lt;Dan.Petrovic@koine.com&gt;; Jason Mochine &lt;Jason.Mochine@koine.com&gt;\r\nSubject: RE: Mutual NDA - countersigned\r\n\r\nHi Campbell,\r\n\r\nThank you for your prompt reply and return of the NDA signed.\r\n\r\nPlease find this attached and countersigned from our end for your files.\r\n\r\nI will leave you to pick up with Jason and Dan.\r\n\r\nMany thanks,\r\n\r\nS