ting involved. Check out our website at http://voiceofblockchain.com and let me know what you think.\r\n\r\nSam Crane\r\nCommunications\r\nVoice of Blockchain','Business &amp; Sales','2019-07-10 16:36:52'),(16,'Todd Enneking','todd.enneking@digital-capital-management.com','We are manage a crypto hedge fund. I am very curious as to which crypto exchanges you have linked your custody solution.\r\n\r\nPlease let me know.\r\n\r\nThank you.\r\n\r\nTodd','Business &amp; Sales','2019-07-11 19:42:11'),(17,'Kymberley McAdam','kymberley.mcadam@aicpa-cima.com','By way of introduction, my name is Kymberley McAdam and I facilitate evening events for Members of the Chartered Institute of Management Accountants in Central London and North Thames.\r\n\r\nWe are currently looking to put on a panel evening event in East London, based around the following concept: \r\n\r\nThe Banking industry and particularly the opportunity for challenger/new banks to compete with the establishment. We are looking to have 2 panel guests, one with the point of view around the banks become redundant over the next 10-20 years and someone from an already Established bank to speak on their point of view. \r\n\r\nTopic: Is traditional banking the thing of the past? A Panel events debating new bank vs traditional banks. \r\nDate: 24th September 2019 Or 9th October (please indicate which date suites you). \r\nTimes:\r\nRegistration of delegates: 6.45pm\r\nPresentation starts: 7.15pm\r\nPresentation ends: 8.30-9pm \r\nLocation: East London (Stratford, Venue TBC)\r\nAttendees: Approx 30-50\r\nPresentation duration: 90mins (inc Q&amp;A)\r\nEquipment hire: Projector, Screen and Flit Chart \r\nPlease bring your own laptop \r\n\r\nPlease let me know if you are able to assist with speaking at out event. \r\n\r\nKind regards \r\nKymberley McAdam','Business &amp; Sales','2019-07-22 13:46:13'),(18,'Yosuman Makhadova','yosuman.makhadova@blockstate.com','Hello Koine team,\r\nI am writing on behalf of Blockstate, a Swiss security token platform. We are currently conducting a study about the global Security Token Ecosystem together with our partner Frankfurt School Blockchain Center, which is planned to be published in August in Finance, Tech and Blockchain media outlets globally. Your company is part of the study. We have done our best to collect reliable data from secondary sources but would be grateful if you could confirm the accuracy of our data as well as fill the gaps of the missing data. Please see the following:\r\n\r\nCountry: UK\r\nFounding Year: 2017\r\nAmount in insurance: Unknown\r\nFunding raised: Unknown \r\nAre you providing custody services to security tokens as well?\r\n\r\nFor reference, have a look at our recent study about the global Security Token Offering market: https://blockstate.com/global-sto-study-en/\r\nhttps://de.cointelegraph.com/news/blockstate-sto-studie-die-ico-ara-ist-vorbei-security-token-etablieren-sich If you have any questions about our study, I would be happy to help you.\r\n\r\nBest wishes,\r\nYosuman Makhadova','Press &amp; Media','2019-07-26 14:14:19'),(19,'Rohan','nurohan@protonmail.com','Hello\r\n\r\nI am interested in your crypto custody solution for a 1,00,000 USD portfolio','Business &amp; Sales','2019-07-26 18:20:46'),(20,'contactnjznmh','brady_lunsford04@rambler.ru','Dear sir! \r\n \r\nWe will send Your messages via follow-up forms to the sites of companies via all domain zones of the world in any languages.  \r\n \r\nThe commercial offer is sent to E-mail address \r\n of firm hundred % will get to inbox folder! \r\n \r\nTest: \r\nten thousand messages on foreign zones to your email address - twenty dollars. \r\nWe need from You only E-mail, title and text of the letter. \r\n \r\nIn our price list there are more 800 databases for all domain zones of the world. \r\nCommon databases: \r\nAll Europe 44 countries 60726150 of domain names - 1100$ \r\nAll European Union 28 countries 56752547 of sites- 1000$ \r\nAll Asia 48 countries 14662