INSERT INTO `news` VALUES (1,'BestNewTech080819113220','Best New Tech','Koine named Best New Tech at the WorldÃ¢â‚¬s Largest FX Buy-Side Conference','<p><strong>London, 26 February 2019</strong> &ndash; Koine, which brings digital assets to institutional capital, has been crowned &lsquo;Best New Tech&rsquo; for its real-time settlement and funds allocation service at the Trade Tech FX USA conference in Miami on 15th Feb 2019, the largest buy-side gathering in the FX world.</p>\r\n<p>&nbsp;</p>\r\n<p>Koine&rsquo;s real-time settlement service and funds allocation between trading venues offers the benefits of transparency, reduced risk and capital efficiency. The award was determined by an audience vote during a &ldquo;shark tank&rdquo; competition (&ldquo;dragon&rsquo;s den&rdquo; format in the UK) with other industry newcomers.</p>\r\n<p>&nbsp;</p>\r\n<p>Koine delivers custody, settlement and funds allocation between venues for both fiat and digital assets. Its solution permits institutional capital to trade digitally whilst conforming to the existing approach for fund mandates, governance and codes of practice.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Phil Mochan, CCO, who represented Koine for the competition, said:</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Winning this award from our peers in the industry is affirmation that Koine has successfully solved the key issues associated with blockchain-based deployments in capital markets, and opened up institutional capital to trade digitally.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;We have created a fundamental piece of market infrastructure that will drive cost-efficiency and risk transformation in the capital markets.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>Over 550 FX industry professionals attended Trade Tech FX USA this year, making it the largest annual event for the industry. Attendees included CTAs, hedge funds, money managers and pension funds.</p>\r\n<p>&nbsp;</p>\r\n<p>Koine&rsquo;s platform will go live in Q2 2019, with clients already signed up. Partnerships with other industry participants will be announced in due course.</p>','https://www.koine.com/images/uploads/news/award.jpg','2019-08-08 11:31:25'),(2,'Koineacquireshireabl080819113846','Koine acquires hireabl','Koine acquires hireabl to strengthen client on-boarding for institutional custody of digital assets','<p><strong>London, 20 May 2019</strong> &ndash; Koine, the specialist financial institution for custody and settlement of digital assets, has acquired Recruitable Ltd (trading as &ldquo;hireabl&rdquo;), a pre-launch, fintech company with a scalable platform for automated client on-boarding.</p>\r\n<p>Koine plans to make a number of strategic acquisitions of innovative, early stage tech-based, IP owners in order to fast-track the integrated end-to-end services that its clients are demanding.</p>\r\n<p>To deliver the best value for its shareholders, Koine&rsquo;s executive team will use their considerable M&amp;A experience to cherry-pick the best pre-revenue acquisitions.&nbsp;</p>\r\n<p>Koine is scheduled to launch next month with its ultra-secure custody and real-time settlement services for digital assets for institutional clients.</p>\r\n<p><strong>Hugh Hughes, Chairman and CEO of Koine said: </strong></p>\r\n<p>&ldquo;Koine has recently completed its second round financing and we are poised for launch and dramatic growth. With this acquisition of talent and technology, we are investing in the client on-boarding experience, for excellence of our customer service and for rapid expansion in our client base. We are delighted that the hireabl team and technology are now within the Koine stable &ndash; our platform positions Koine to become a major institutional custodian of digital assets&rdquo;.</p>\r\n<p><strong>Jason Mochine, CEO at hireabl, and now Head of Sales at Koine said: </strong></p>\r\n<p>&ldquo;We are convinced of the business and technical synergies of integrating our scalable client on-boarding capability into the Koine global offering. There is massive client interest in the provision of institutional custody and settlement of digital assets. Clients and prospects are impressed at gaining the ability to increase their capital efficiency and reduce settlement risk through real-time interoperability with multiple global trading venues on the single Koine custody system. The addition of an automated KYC/AML/CTF platform as part of the Koine architecture ensures highly efficient and scalable client on-boarding&rdquo;.</p>\r\n<p>The founders of hireabl, David Grocott (formerly COO) and Matt Dangerfield (formerly CTO) have joined Koine to take up similar roles, adding further strength to its senior team.</p>','https://www.koine.com/images/uploads/news/k-home.png','2019-08-08 11:34:53'),(3,'KoineGeneralCounselrowsintotherecordbooks240919024504','Koine General Counsel rows in to the record books','Koine General Counsel and former Olympic rower, Simon Leifer, has broken the Guinness World Record for rowing the length of Loch Ness in the fastest time','<p>Simon, a former national champion rower, was previously a Guinness World Record for rowing the Thames in the fastest time.</p>\r\n<p>He joined forces with 13 other seasoned rowers, all with a similar with racing pedigree.</p>\r\n<p>The intrepid team travelled the length of the 20.5-mile long loch in 2 hours, 26 minutes and 57 seconds, almost a minute quicker than the previous record holders.</p>\r\n<p>This is the first of an incredible three World Record attempts for the team, which will shortly see them crossing the English Channel and the length of the Thames.</p>\r\n<p>Simon said: &ldquo;I couldn&rsquo;t have asked for a better team to do this &lsquo;monstrous&rsquo; challenge with. It was tough at times but we got through it all as a team.</p>\r\n<p><img src=\"data:image/tiff;base64,\" /><img src=\"data:image/tiff;base64,\" /></p>\r\n<p>&ldquo;Loch Ness was a wonderful setting to start our triple world record bid, and I can&rsquo;t wait to take on the Thames and Channel! There is still a lot of training to be done &ndash; though I am thankful for the rests in between.&rdquo;</p>\r\n<p>The rowing boat, from the Basque region of northern Spain, is a state-of-the-art fiberglass copy of an old fishing boat, on its home turf races in the boats draw crowds of thousands.</p>\r\n<p>The methods of measuring record attempts and personal bests have changed throughout Simon&rsquo;s history of endurance sport, with the introduction of digital measurements based on GPS.</p>\r\n<p>&ldquo;Gone are the days of stopwatches&rdquo;, Simon said. &ldquo;It can seem a little odd at first, because we&rsquo;re so used to the old methods, but sport and beating records is all about accuracy so it&rsquo;s great that we can use this state-of-the-art technology to support us in achieving our goal.&rdquo;</p>\r\n<p>Hugh Hughes, CEO and Chairman at Koine, said: &ldquo;Simon&rsquo;s success with this challenge is a testament to his ability to work in sync with his team, coming together with a combined focus and common goal &ndash; something that is also reflected in the way he approaches his day-to-day work at Koine.</p>\r\n<p>&ldquo;This is an incredible achievement and the whole team at Koine wishes Simon well in his treble record quest.&rdquo;</p>','https://www.koine.com/images/uploads/Simon%20HS.png','2019-09-19 13:52:41'),(4,'KoinefeaturedinTheTimessupplement240919024435','Koine featured in The Times supplement','In a Raconteur supplement for The Times on the \'Future of Money\', Koine\'s Chief Commercial Officer, Phil Mochan, comments on the money lost by QuadrigaCX','<p>In the supplement for The Times Phil Mochan comments on the money lost by QuadrigaCX and the necessity of having robust security and custody systems in place to prevent such events happening again.</p>\r\n<p>Phil commented: &ldquo;This is part of the process is flushing out the bad actors. There are over 380 trading venues and more opening all the time. There will be a significant contraction in coming years.</p>\r\n<p>&ldquo;The risk-taking pioneers, having staked out the new territory, need to give way to the engineers who will build solid foundations for growth. Corporate investment will continue to flow into the sector, unaffected by these events. Ultimately, cryptosecurity is not about how strong the door is, it&rsquo;s about who has the key and how often you open the door.&rdquo;</p>\r\n<p>Click <a href=\"https://www.raconteur.net/finance/quadrigacx-cryptosecurity\">here</a> to read the full article.</p>','https://www.koine.com/images/uploads/news/analytics-3088958_1280.jpg','2019-03-15 14:00:10'),(5,'KoinefeaturedinCityAM240919024517','Koine featured in City AM','In this edition of City AM, crypto insider James Bowater spoke to Koine chairman and CEO Hugh Hughes.','<p>&ldquo;We are scaling up for our go-live&rdquo; said Hugh. &ldquo;In contrast to those City firms moving resources out of London, we are investing heavily. We are in final stage testing with our blockchain-based platform for custody and settlement of digital assets. We will be a major institutional custodian &ndash; watch this space.&rdquo;</p>\r\n<p>Click <a href=\"https://www.cityam.com/wp-content/uploads/2019/06/crypto-9-apr2019-5cac5f092456a.pdf\">here</a> to read more from Crypto AM.</p>','https://www.koine.com/images/uploads/team/Hugh_Hughes1.jpg','2019-04-04 14:00:10'),(7,'KoinefeaturedinIgnitesEurope240919024834','Koine featured in Ignites Europe','KoineÃ¢â‚¬s CRO, Francesco Roda, says regulatory uncertainty is Ã¢â‚¬Å“probably the keÃƒy challenge faced by new enterprises built around the tokenisation of valueÃ¢â‚¬','<p>Aberdeen Standard Investments announced that it is working with Citigroup to build &ldquo;tokenised&rdquo; real estate assets using distributed ledger technology.</p>\r\n<p><a href=\"https://www.igniteseurope.com/c/2401613/288283/aberdeen_testing_tokenisation_illiquid_assets?referrer_module=issueHeadline&amp;module_order=0\">In this piece<em> featured in Ignites Europe</em></a>, Koine&rsquo;s CRO, Francesco Roda, says regulatory uncertainty is &ldquo;probably the key challenge faced by new enterprises built around the tokenisation of value&rdquo;.</p>\r\n<p>Mr Roda adds that counterparty risk associated with the trading and settlement of digital assets is still a &ldquo;critical issue&rdquo; for investors as current markets for digital assets lack segregation between distribution, custody and settlement of assets. &ldquo;Collusion has plagued this nascent market since its inception, with high-profile internal hacks that have seen dozens of high-profile exchanges disappear, often with client money.&rdquo;</p>\r\n<p><em>Please note, the article is behind a paywall.</em></p>','https://www.koine.com/images/uploads/icons/custody-of-drypto.png','2019-07-03 14:48:14'),(8,'KoinefeaturedinFinanceDerivatives240919025041','Koine featured in Finance Derivatives','Should crypto assets continue to be treated as commodities; the role of consensus algorithms in the classification of assets','<p><em>As featured in </em><a href=\"https://www.financederivative.com/should-crypto-assets-continue-to-be-treated-as-commodities-the-role-of-consensus-algorithms-in-the-classification-of-assets/\"><em>Finance Derivatives</em></a></p>\r\n<p><em>Author: Francesco Roda, Chief Risk Officer at Koine</em></p>\r\n<p>Digitalisation of value is beginning to permeate markets, following the launch of several initiatives in 2019<a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftn1\" name=\"_ftnref1\">[1]</a>; in June of the same year, Facebook catapulted digital assets to notoriety with Libra<a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftn2\" name=\"_ftnref2\">[2]</a>.&nbsp;</p>\r\n<p>Markets are attracted by the benefits of the new digital world: broader liquidity, efficient distribution, lower costs and more efficient use of capital.</p>\r\n<p>At the intersection of the digital world and financial markets lies the handling of rights over assets and the transmission of value, firmly anchored to the concept of a currency.</p>\r\n<p>Currencies are well defined and understood in financial markets but have fuzzy contours in the digital world. Uncertainty renders the translation of cash from financial to digital problematic. Banks invariably point the finger to risk; money laundering is deemed to be higher in the digital world.&nbsp; This is, in my view, unsubstantiated &ndash; so long as intermediaries follow the rules.&nbsp;&nbsp;</p>\r\n<p>Stable coins appear to address this issue elegantly: a token linked to fiat but that does not require intermediaries<a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftn3\" name=\"_ftnref3\">[3]</a> - neither new nor established ones.&nbsp;</p>\r\n<p>Yet, stable coins and large-scale electronic money initiatives<a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftn4\" name=\"_ftnref4\">[4]</a> may soon see a third contender in the race for innovation.</p>\r\n<p>The current generation of mainstream crypto assets possess very few traits of real-world currencies; the absence of yield and material costs of carry, coupled with high volatility, render crypto assets unsuitable for payments. Similar considerations apply to gold; indeed, early initiatives of gold backed coins failed to attract interest or failed to launch at all.</p>\r\n<p>Proof of stake is a new consensus algorithm that could reshape crypto assets; this is an alternative to proof of work, the consensus mechanism that underpins all major coins like Bitcoin and the current implementation of Ethereum<a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftn5\" name=\"_ftnref5\">[5]</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>Staking refers to the coins that miners<a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftn6\" name=\"_ftnref6\">[6]</a> are required to deposit to guarantee their work. The network rewards authentic verification with a fee and penalise bad miners by taking away their deposit if it determines that they violated the blockchain rules.</p>\r\n<p>&nbsp;</p>\r\n<p>Miners can continue to earn a fee, which is proportionate to the amount of coin deposited, for the duration of the deposit held by the network. This makes the return on deposits risk free.</p>\r\n<p>In other words, proof of stake blockchains offers the opportunity to earn a risk-free interest on the deposits; this makes them akin to central banks which provide money supply management and risk-free deposits<a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftn7\" name=\"_ftnref7\">[7]</a> to the economy<a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftn8\" name=\"_ftnref8\">[8]</a>. The risk-free return paid on the coins deposited anchors their value, albeit endogenously, to a known reference point, potentially rendering valuations relative to exogenous prices, more stable.</p>\r\n<p>&nbsp;</p>\r\n<p>New coins may render stable coins redundant and, if successful, compete with central bank issued currencies.&nbsp; Their classification from a regulatory point of view may prove challenging: the decentralised nature may prevent them from being treated as currencies or financial assets. Their ability to transmit and store value would point to the opposite conclusion, with intermediaries would face regulatory uncertainty. The pooling of coins from different parties, for example, to meet the minimum amount required to participate in the staking process, could be viewed as a collective investment scheme, albeit no cash nor financial instruments are involved.</p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftnref1\" name=\"_ftn1\">[1]</a> For example, SocGen issued a covered bond (EUR 100m) in April 2019 on Ethereum and the German regulator authorised a USD 250m real estate-backed token on Ethereum.</p>\r\n<p><a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftnref2\" name=\"_ftn2\">[2]</a> Lybra is issued by a consortium on a permissioned blockchain and is backed by a basket of currencies. If it is successful in satisfying regulation which is ill prepared and not coordinated globally to deal with large scale electronic money services initiatives, Libra will be a major innovation in cross border and domestic payments.</p>\r\n<p><a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftnref3\" name=\"_ftn3\">[3]</a> With the exception, of course, of its initial issuance against, and redemption for, cash.</p>\r\n<p><a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftnref4\" name=\"_ftn4\">[4]</a> Mobile payment volumes in China reached 277.4 trillion yuan ($41.51 trillion) in 2018, up more than 28 times from five years ago, according to the People&rsquo;s Bank of China (PBOC). Alipay alone has over 600m active users.</p>\r\n<p><a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftnref5\" name=\"_ftn5\">[5]</a> Ethereum has a plan to migrate to a proof of stake algorithm.</p>\r\n<p><a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftnref6\" name=\"_ftn6\">[6]</a> Miners are the agents on a blockchain that verify the authenticity and validity of transactions, prior to adding them to the blockchain.</p>\r\n<p><a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftnref7\" name=\"_ftn7\">[7]</a> As opposed to a central bank, proof of stake blockchains pay interest on deposits on an almost continuous basis, with the interval given by the time difference between blocks; given the short time interval between blocks, compounding can be approximated with a continuous function.</p>\r\n<p><a href=\"applewebdata://70D903CE-A412-43C5-87A5-0259450A5C0F#_ftnref8\" name=\"_ftn8\">[8]</a> This is valid only if the blockchain is truly decentralised, i.e. no parties can exercise control on it.</p>','https://www.koine.com/images/uploads/team/Francesco_Roda1.jpg','2019-08-13 14:50:41'),(9,'KoinefeaturedinInformationAge240919025645','Koine featured in Information Age','KoineÃ¢â‚¬s Chief Risk Office, Francesco Roda, spoke to Information Age about the rise of digital assets and following the use of the blockchain in financial services.','<p>&ldquo;Liquidity is very crucial in financial markets; the lack of it is very costly and very problematic for both the issuers and the holders of the financial assets &mdash; it presents another way to distribute and get your product out there to those that want it,&rdquo; he said.</p>\r\n<p>&ldquo;The fact that there is no single guardian or intermediary means the blockchain (in finance or elsewhere) acts like the internet.&rdquo;</p>\r\n<p>&ldquo;You don&rsquo;t have a single intermediary which guarantees the operations of the internet, you have just a multitude of nodes and each node is at the same level, it&rsquo;s a peer compared to the other nodes, and that&rsquo;s what makes the internet so widespread, but also so reliable and so resilient.&rdquo;</p>\r\n<p>Speaking on how challenger banks, such as Revolut, as adopting this technology, Francesco said: &ldquo;Revolut effectively allows its customers to buy Bitcoin as part of their portfolio. There are a number of initiatives in the FCA regulatory sandbox that actually truly merge the world of financial services with the world of digital assets and the world of blockchain technologies; using blockchain to enable cross-border payments, for example.&rdquo;</p>\r\n<p>As well as discussing Facebook&rsquo;s Libra coin, Francesco spoke about the future of blockchain: &ldquo;I see the bright future for blockchain; in effectively enabling and making distribution of financial products fairer, cheaper, more cost effective and therefore, enhancing the liquidity profile of what typically has been very illiquid assets.&rdquo;</p>\r\n<p>You can read the full article <a href=\"https://www.information-age.com/blockchain-financial-services-digital-assets-123484504/\">here</a>.</p>','https://www.koine.com/images/uploads/news/blockchain-3750157_1920.jpg','2019-08-14 14:51:26'),(10,'KoinefeaturedinGlobalInvestor240919025726','Koine featured in Global Investor','Libra: The catalyst for central banks to take crypto seriously?','<p><em>As featured in <a href=\"https://www.globalinvestormagazine.com/articles/3693279/libra-the-catalyst-for-central-banks-to-take-crypto-seriously-\">Global Investor</a></em></p>\r\n<p><em>Author: Francesco Roda, Chief Risk Officer at Koine</em></p>\r\n<p>Libra generated a lot of interest since its announcement on a Tuesday in June 2019. That morning I was speaking at a panel on the future of digital assets and I immediately raised the challenges that such a product poses to regulators of the countries in which it is used &ndash; potentially the entire world.</p>\r\n<p>Libra can be described simply as a new cryptocurrency to settle payments or, from a regulatory point of view, as an e-money product. The difference is subtle; cryptocurrencies may try to mimic certain features of sovereign ones (fiat). but they are not issued by any specific country. Rather they are issued by an algorithm (which governments have not yet figured out a method to regulate) or by unregulated entities who operate on the borders of legality. E-money products, in contrast, are issued by institutions regulated by the governments in which they operate. The &ldquo;e&rdquo; refers to their specific nature, but &ldquo;money&rdquo; clearly points to the fact that they serve the same purpose &ndash; at least in the country in which they are authorised.</p>\r\n<p>I argued that Libra is an e-money product that will require obtaining specific authorisation from regulators of the countries in which it operates &ndash; more or less the entire world &ndash; or be seen with suspicion by regulators.</p>\r\n<p>The majority of fiat money is already &ldquo;electronic&rdquo; as national payment flows, measured in value, are predominantly executed by updating computer records rather than moving physical cash. What is the missing ingredient for fiat money to turn into digital?</p>\r\n<p>Central banks of the UK and Sweden, among other countries, have researched the adoption of blockchain technologies extensively but have yet to come to firm plans for their issuance.</p>\r\n<p>A cryptocurrency from China\'s central bank?</p>\r\n<p>Rumours have circulated that China&rsquo;s central bank will launch a state-backed cryptocurrency and issue it to seven intermediaries in the coming months. Among those are Alibaba (a Chinese online market place turned into one of the largest banks in the world) and Tencent (a Chinese social media platform turned into one the largest e-money institution in the world) together with other large traditional banks.</p>\r\n<p>The timing of the announcements may not be a coincidence: Libra has revived interest in cryptocurrencies, prompting people to think about the consequences of a private currency issued by a large US company.</p>\r\n<p>What makes the e-renminbi - or Digital Currency/Electronic Payments (&ldquo;DC/EP&rdquo;) - different from any renminbi-denominated electronic payment flow has not yet been fully disclosed. I am thinking about issues around privacy of transactions: blockchains are immutable and &ndash; in the long run &ndash; account numbers may lose their anonymity, as identities can be inferred by looking at flows and public information that invariably businesses and people leak online. Other interesting elements are the degree of control by the issuer (other than the legitimate control over rates and supply) and the freedom of circulation.&nbsp; The choice of blockchain technologies made by DC/EP suggests that it will enable peer to peer payments, thus removing the need for intermediaries. This makes it an efficient tool for legitimate businesses and criminal enterprises alike.</p>\r\n<p>A growing interest from central banks?</p>\r\n<p>Libra is probably not the only catalyst for the increased interest in central bank-issued digital currencies.&nbsp; The Governor of the Bank of England believes that the current international monetary system contributes to lower global interest rates and has amplified the difficulties central bankers face in addressing downturns. In a recent speech at the gathering of central bankers in Jackson Hole, he observed that the US accounts for only 10 per cent of global trade and 15 per cent of global GDP but half of trade invoices and two-thirds of global securities issuance.</p>\r\n<p>Carney observed that &ldquo;US developments have significant spillovers onto both the trade performance and the financial conditions of countries even with relatively limited direct exposure to the US economy\".</p>\r\n<p>According to Carney, a Synthetic Hegemonic Currency, provided by a network of central bank digital currencies, could dampen the domineering influence of the U.S. dollar on global trade.</p>\r\n<p>Furthermore, &ldquo;while the world economy is being reordered, the US dollar remains as important as when Bretton Woods collapsed&rdquo;.</p>\r\n<p>The dollar peg to gold and semi-fixed exchange rates for other currencies was, in short, the proposal made by the American delegation at the Bretton Woods conference held in 1944 to help prevent a recurrence of the Great Depression.</p>\r\n<p>John Maynard Keynes presented, on behalf of the British delegation, the \"International Clearing Union\" &ndash; an organisation that potentially every country in the world could join. It would create a new reserve currency, the \"Bancor,\" that could be used for settling international accounts &ndash; removing the need for the Dollar (or other currency) to be adopted as global reserve currency.</p>\r\n<p>The similarities between the Synthetic Hegemonic Currency and Bancor are striking, not least the issues that the two proposals are trying to address.</p>\r\n<p>The exponential increase in global trade and the ability of blockchain technologies to distribute value globally are pushing central banks and regulators to rethink their approach.&nbsp; The IMF too, in a recent survey, learned that central banks are increasingly interested in issuing digital currencies to lower costs, increas efficiency of monetary policy implementation, counter competition from cryptocurrencies, ensure contestability of the payment market, and offer a risk-free payment instrument to the public.</p>','https://www.koine.com/images/uploads/news/crypto-3569795_1920.jpg','2019-09-19 14:53:42'),(11,'KoinefeaturedinBestExecution301019021827','Koine featured in Best Execution','Best Execution interviews Francesco Roda','<p>Best Execution magazine interviewed our Chief Risk Officer, Francesco Roda, on how digital-assets can create liquidity for their article on navigating the crypto liquidity landscape by Jannah Patchay.</p>\r\n<p>&ldquo;Liquidity is primarily a feature of the market in which the asset is traded. It is driven by the interest and the demand that the asset can attract, the ease with which the asset can be converted into cash and the barriers to entering the market in which the asset is traded. So, bringing down the barriers to accessing assets is a way of creating liquidity,&rdquo; said Francesco.&nbsp;</p>\r\n<p>&ldquo;Liquidity is made by market makers &ndash; but in traditional markets, market making is costly in terms of capital. Digital assets can lower the operational barriers to entering the market, potentially allowing new types of player &ndash; which may have a lower cost, or a surplus, of capital &ndash; to become market makers,&rdquo; he added.</p>\r\n<p>CLICK HERE to read the full article: <a href=\"https://www.bestexecution.net/crypto-assets-finding-liquidity-jannah-patchay/\">https://www.bestexecution.net/crypto-assets-finding-liquidity-jannah-patchay/</a>&nbsp;</p>','https://www.koine.com/images/uploads/Screenshot%202019-10-30%20at%2014.18.12.png','2019-10-30 14:08:28'),(12,'KoineinterviewedbyTheTradeatSibos301019022009','Koine interviewed by The Trade at Sibos','Phil Mochan discusses institutional capital and digital assets','<p>Phil Mochan, Head of Strategy &amp; Corporate Development at Koine, talks to TRADE TV at Sibos in London about whether the existing assets security model is sufficient to attract institutional capital and satisfy regulators, and the role of the traditional custodian in the future.</p>\r\n<p>Click here to watch the video: <a href=\"https://www.thetradenews.com/multimedia/koine-institutional-capital-digital-assets/\">https://www.thetradenews.com/multimedia/koine-institutional-capital-digital-assets/</a>&nbsp;</p>','https://www.koine.com/images/uploads/team/Screenshot%202019-10-30%20at%2014.18.59.png','2019-10-30 14:15:52'),(13,'KoinespeaksatDigitalAssetStrategySummit301019022331','Koine speaks at Digital Asset Strategy Summit','Phil Mochan took to the stage to discuss digital assets','<p>Thanks to the Digital Asset Strategy Summit (DASS) in Dallas for giving us a platform to go beyond the narrow subject of digital asset custody, examining the trade life cycle of digital assets.</p>\r\n<p>Koine Co-Founder and Head of Strategy &amp; Corporate Development, Phil Mochan, discussed the risks associated with trading and investing in digital assets.&nbsp;<br /><span id=\"ember2023\" class=\"ember-view\"></span></p>','https://www.koine.com/images/uploads/Capture%202.jpeg','2019-10-30 14:23:10'),(14,'KoinespeaksatDigitalPrivatePlacementsEvent301019023021','Koine speaks at Digital Private Placements Event','Francesco Roda spoke as part of the panel','<p>CRO Francesco Roda represented Koine in the panel of the London Digital Private Placement Event, hosted by Jeffrey Sweeney.</p>\r\n<p>The event saw <a href=\"https://uscapglobal.com/\" target=\"_blank\" rel=\"nofollow noopener\">US Capital Global</a> and <a href=\"https://thefintechtimes.com/\" target=\"_blank\" rel=\"nofollow noopener\"><em>The Fintech Times</em></a> join forces i to host a digital private placements event in London&rsquo;s up-and-coming FinTech venue, Rise London. Held in the Barclays-created community workspace known as &ldquo;the home of FinTech&rdquo;, the event attracted leading FinTech thinkers and doers.</p>\r\n<p>Click here to read more:</p>\r\n<p><a href=\"https://www.linkedin.com/pulse/jeffrey-sweeney-speaks-london-digital-private-event-jeffrey-sweeney/?trackingId=L%2B1nS%2F%2BKT36kjh85pYa1Ig%3D%3D\">https://www.linkedin.com/pulse/jeffrey-sweeney-speaks-london-digital-private-event-jeffrey-sweeney/?trackingId=L%2B1nS%2F%2BKT36kjh85pYa1Ig%3D%3D</a>&nbsp;</p>','https://www.koine.com/images/uploads/Screenshot%202019-10-30%20at%2014.28.23.png','2019-10-30 14:30:21'),(15,'KoineaddressesaudienceinSanFrancisco141119073730','Koine addresses audience in San Francisco','Phil Mochan spoke about the current the landscape of the UK blockchain','<p><span style=\"background-color: #ffffff;\">Koine\'s Founder, Head of Strategy &amp; Corporate Development</span>, Phil Mochan, discussed the current landscape of the UK blockchain along with Jeffrey Sweeney of US Capital Global, Blake Richman of Vertalo and Aaron Travis of Tokenvault in San Francisco.&nbsp;</p>','https://www.koine.com/images/uploads/IMG_6216.JPG','2019-10-30 14:33:18'),(16,'KoinesecuresFCAEMIauthorisation311019010457','Koine secures FCA EMI authorisation','Koine was granted authorisation for the issuance of electronic money (EMI Licence) by the Financial Conduct Authority (FCA)','<p>Koine selected the UK as its jurisdiction of preference to start its regulatory journey. Koine is also in the process of applying for a number of authorisations in other major financial services locations.</p>\r\n<p>The EMI authorisation allows for Koine to provide real-time e-Money payment services to the growing institutional client universe. While it is linked to, and facilitates the custody and settlement model described below, these services are currently outside the UK regulatory perimeter and the e-Money authorisation should not be read as authorisation of Koine&rsquo;s transformative custody and settlement model for digital assets.</p>\r\n<p>This model eliminates settlement and counterparty risks by enforcing DVP, while ensuring clients at all times retain beneficial ownership of their assets throughout the trade lifecycle.&nbsp;</p>\r\n<p>Inspired by the best practices of world-famous traditional custodians, Koine has overcome the challenge of safekeeping and settlement of bearer instruments.</p>\r\n<p>With more than 40 institutions, funds and family offices onboarded, Koine represents the culmination of two years&rsquo; governance, legal and technical programmes to create an infrastructure suitable for institutional capital. It has engineered a unique solution that sets itself apart from the current hot wallet/cold store model with manual transfers, providing heightened security of assets, with instant settlements and withdrawals.</p>\r\n<p>Leading the Koine team as CEO and Chairman is Hugh L. Hughes, ex-CEO of Soci&eacute;t&eacute; G&eacute;n&eacute;rale Securities and co-founder of Fixnetix.</p>\r\n<p>Hughes said: &ldquo;Market reaction to Koine&rsquo;s ultra-secure scalable institutional class solution for custody and settlement, has been immensely favourable, and with our EMI authorisation now issued by the FCA, we are rapidly moving to implement the market infrastructure necessary to support institutional participation in the digital assets marketplace.</p>\r\n<p>&ldquo;The FCA&rsquo;s recognition of the controls and processes that we have put in place for our EMI authorisation, notwithstanding their concerns regarding the digital markets, shows that London can continue to attract financial institutions in the digital markets, alongside traditional capital markets, as long as those institutions can show that they have appropriate governance to address the regulator&rsquo;s requirements.&rdquo;</p>','https://www.koine.com/images/uploads/news/blockchain-3750157_1920.jpg','2019-10-31 12:48:27'),(17,'KoineappointsformerSDXCEO261119111316','Koine appoints former SDX CEO','Koine, the institutional custodian and settlement service for digital assets and fiat money, has appointed former CEO of SIX Digital Exchange (SDX), Martin Halblaub, as Chair of its advisory board, effective 1stÃ‚January 2020','<p>As former CEO of SDX, Switzerland&rsquo;s digital assets exchange, Martin shaped the business&rsquo; strategy, model and core technology, as well as the client and product portfolio, and built the operating company.</p>\r\n<p>Martin&rsquo;s appointment is the first of a series to the Global Advisory Board that Koine is creating to sit above each of its regulated entities, supporting the company as it continues its growth trajectory.</p>\r\n<p>He joins a senior team of founders and non-executive directors from Soci&eacute;t&eacute; G&eacute;n&eacute;rale, EY, Bacs Payment Schemes, Bank of England and Kleinwort Benson, amongst others.</p>\r\n<p>Martin&rsquo;s career has been always in banking and financial services, successfully building, scaling-up and leading businesses in international capital markets, corporate and investment banking and asset management, chairing over a dozen companies.</p>\r\n<p>Prior to SDX, Martin held positions as Chairman, Board Member, CEO and Senior Executive at international financial institutions and asset managers. He was also Senior Advisor to SIX Group, the Switzerland&rsquo;s financial market infrastructure operator.</p>\r\n<p>Martin has also held the positions of Senior Advisor at DWP Bank, the German securities processing bank for financial institutions, and European commercial bank WestLB. He was Managing Director for Risk Management at LBBW, one of Germany&rsquo;s largest banks with total assets of EUR 238 billion, Head of Global Markets at&nbsp;HSH Nordbank, the German \"bank for entrepreneurs\", member of the management board of NORD/LB and&nbsp;President of the Hannover Stock Exchange.</p>\r\n<p>A German national, Martin has studied at the University of Oxford, HEC Paris, INSEAD Business School, the University of Edinburgh, and the universities of Seville and Mannheim.</p>\r\n<p><strong>Phil Mochan, Founder and Head of Strategy &amp; Corporate Development at Koine, said:</strong>&nbsp;&ldquo;Koine brings together experienced capital market professionals with entrepreneurial spirit to create digital infrastructure solutions for market participants seeking to win out from the digital transformation process.</p>\r\n<p>&ldquo;As the former CEO of SDX, the Swiss-based digital exchange established by SIX, which has pioneered the entry of digital assets into the institutional market, Martin has the insight, know-how and reputation in bringing digital assets and money to the institutional capital markets and supporting incumbents with their digital transitions. He is a fantastic addition to our team.&rdquo;</p>\r\n<p><strong>Martin said:</strong>&nbsp;&ldquo;Koine&rsquo;s value proposition enables the smooth movement of today&rsquo;s financial markets frictionless into the digital age, and their industry-grade technology and the business acumen of their outstanding team are an ideal starting point to create value for all market participants. I look forward to being part of this journey and supporting Koine as they roll out globally their digital asset custody and settlement platform.&rdquo;</p>\r\n<p>Koine is a leading provider of digital asset and fiat money custody, settlement services and electronic money, creating a platform for professional market participants in a regulated environment.</p>','https://www.koine.com/images/uploads/team/Martin%20Halblaub%20%282%29.png','2019-11-26 11:11:02'),(18,'KoineengagesUSCapitalGlobalSecuritieson50MMequityraise100120083234','Koine engages US Capital Global Securities on $50MM equity raise','Funding will be used to support KoineÃ¢â‚¬s international growth as it brings custody and settlement for digital assets to additional jurisdictions','<p>Koine, the provider of segregated, institutional custody and settlement services for digital assets, has retained US Capital Global Securities as its lead financial advisor on a $50 million equity raise.</p>\r\n<p>Koine will utilise the $50 million equity financing to diversify its service offerings and acquire additional regulatory permissions to support its strategic international growth.<strong><br /></strong></p>\r\n<p>Founded in London in 2017, Koine brings together the full suite of governance, compliance, risk management, and audit of real-time trading to the digital ecosystem. Its state-of-the-art platform has been engineered to provide clients with the tools to manage their assets in a low latency, high-volume environment and benefit from notably increased security, agility and efficiency.</p>\r\n<p>Headquartered in San Francisco, US Capital Global is a full-service private financial group with an established track record in debt and equity finance, investment management, and financial advisory. All strategic advisory, private placements, securities, and other related services are offered by the group&rsquo;s FINRA-licensed broker dealer affiliate, US Capital Global Securities LLC.</p>\r\n<p><strong>Hugh Hughes, Chairman and CEO at Koine</strong>, said: &ldquo;Market reaction to Koine&rsquo;s ultra-secure scalable institutional class solution for custody and settlement, has been immensely favourable. As we enter 2020, we are focused on driving and supporting international participation in the digital assets marketplace with our application for regulatory licenses in other trusted jurisdictions, in line with our aim to become the most highly-regulated solution for custody and settlement of digital assets globally.</p>\r\n<p>&ldquo;US Capital Global&rsquo;s proven experience and valuable insight into capital formation, especially in the FinTech arena, will be tremendously beneficial to us at this crucial time in Koine&rsquo;s development.&rdquo;</p>\r\n<p><strong>Charles Towle, CEO at US Capital Global Securities</strong>, said: &ldquo;It&rsquo;s an honour to serve Koine as its placement agent and lead financial advisor for this upcoming investment opportunity as we engage selected dealers to expand the distribution of this offering. Koine is driven by an expansive, forward-thinking vision of the digital assets market that we at US Capital Global find very exciting.&rdquo;</p>','/images/uploads/news/Koine%20hands%20edit.jpeg','2020-01-09 09:15:27');
