INSERT INTO `pages` VALUES (1,'news','Koine News','','some text'),(2,'partnerships','Partnerships','Custody of Digital Assets','To help digital issuance projects to advance, Koine connects clients with the leading players in every segment of the digital issuance community. We are highly connected and engaged with issuers of digital securities, with structurers and distributors, with client KYC/AML/CTF agents and clean asset validators, and with investment managers, primary listing exchanges, liquidity aggregators, second trading venues, with OTC &amp; future brokers and with the support network providers such as legal and marketing. If you need to find the best partners for your digital issuance project, contact Koine.&nbsp;');
