INSERT INTO `team_bio` VALUES (1,'https://www.koine.com/images/uploads/team/al_moore.png','Al','Founder, Business Development Director','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Formerly an FCA regulated director of Tullett Prebon Equities &amp; Securities, co-founded Fixnetix in 2007 (Winner of the Deloitte Fast 50 &ndash; the fastest growing technology company in the UK in 2011). Technology entrepreneur &amp; non- exec director of multiple tech start-ups.</p>\r\n</body>\r\n</html>','2019-07-03 12:10:59',2,'1','Al_Moore','https://www.koine.com/images/uploads/team/al_moore1.jpg','Moore'),(2,'https://www.koine.com/images/uploads/team/Hugh_Hughes.png','Hugh','Chairman & CEO','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>With an investment banking and capital markets career spanning over 40 years, Hugh has worked in senior roles for a plethora of leading financial services firms including UBS, Barclays and BNP Paribas. <br />Hugh was CEO of Soci&eacute;t&eacute; G&eacute;n&eacute;rale Securities for nearly 10 years where, during his time there, he set up ITGE, a joint venture between ITG Inc. and Soci&eacute;t&eacute; G&eacute;n&eacute;rale in London, spearheading ITG Inc.&rsquo;s expansion into Europe.<br />He has been responsible for brokering several large-scale mergers and acquisitions including the sale of Savory Milln International to UBS and the sale of Fixnetix, a secure, low-latency network connected globally to trading venues which Hugh co-founded, to CSC (now DXC Technology).<br />Hugh is a Member of the Chartered Institute for Securities &amp; Investments, a Freeman of the City of London, a Member of the Guild of Freeman and a former Member of the Stock Exchange.</p>\r\n</body>\r\n</html>','2019-07-03 12:25:49',1,'1','Hugh_Hughes','https://www.koine.com/images/uploads/team/Hugh_Hughes1.jpg','Hughes'),(5,'https://www.koine.com/images/uploads/team/Phil_Mochan.png','Phil','Founder, Head of Strategy & Corporate Development','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>With over 35 years of international experience, Phil has founded, held C-level positions and managed international teams at a number of businesses across a diverse range of industries including technology, payments, telecoms and media.<br />A six year stint in British Telecom in Product Management for the pre-internet business services preceded nearly a decade of strategic consulting to European enterprises.<br />As a principal financier, Phil completed a number of significant transactions exploiting regulatory arbitrage, and managed international teams for projects worth hundreds of millions in ITC outsourcing and management consulting businesses.<br />Phil has founded several businesses in media and payments, and has held non-executive director positions in various high growth companies in telecoms and technology.<br />In his youth he co-founded an international wargaming fanzine and produce two hit computer games.He now mentors young entrepreneurs with a strong interest in the history of economic development and foresees the coming revolution arising from the digitalisation of finance.</p>\r\n</body>\r\n</html>','2019-07-03 12:37:33',3,'1','Phil_Mochan','https://www.koine.com/images/uploads/team/Phil_Mochan1.jpg','Mochan'),(6,'https://www.koine.com/images/uploads/team/Nic%20Martin.png','Nic','Managing Director','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Nic is a senior figure in the financial services industry with over 30 years&rsquo; experience in the UK and international markets, working for companies such as ABN AMRO, Fortis Bank and Bank Al-Khair and holding numerous directorships.<br />During his time as CEO and Executive Director of BFC Bank Ltd, he successfully applied for UK Banking licence and Direct Membership of UK&rsquo;s Faster Payment, establishing an operating model and live governance.<br />He has a proven track record of building and managing successful businesses, having established a UK challenger bank, driven strategic change, developed and implemented new business models, led teams through change and revitalised operations in both small and large multi-cultural environments.</p>\r\n</body>\r\n</html>','2019-07-03 12:43:35',4,'1','Nic_Martin','https://www.koine.com/images/uploads/team/Perfocal-19-04-04_WOG2BI-web-157.jpg','Martin'),(7,'https://www.koine.com/images/uploads/team/Alex_Wilkinson.png','Alex','Chief Operating Officer','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Former Principle of European Venture Fund COO /CRO, GKFX. GM, Clearing &amp; Execution Services at INTLFCSTONE. Former MD, RBC Global Co-Head Futures &amp; Base Metals. MD, Global Head Listed Derivatives. MD, Dresdner Kleinwort Benson. MD, Fimat Banque Ltd. (Soci&eacute;t&eacute; G&eacute;n&eacute;rale).</p>\r\n</body>\r\n</html>','2019-07-03 12:47:12',5,'1','Alex_Wilkinson','https://www.koine.com/images/uploads/team/Alex_Wilkinson1.jpg','Wilkinson'),(8,'https://www.koine.com/images/uploads/team/Jason_Mochine.png','Jason','Head of Sales','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Jason has worked for over 30 years in the capital markets financial technology arena, occupying various commercial roles with market leading and start-up FinTech firms in market data, trading technology, digital identification and in bringing technical solutions to the financial markets.<br />He has held senior management and sales roles at companies including Citigroup (Quotron Ltd), SIX (Telekurs AG), Thomson Reuters (Reuters) and &ldquo;hireable&rdquo; (Recruitable Ltd). During his time as Commercial Director at Fixnetix (now DXC Technology), Jason was responsible for identifying new markets, structuring the commercial proposition, working with partners, key suppliers, investors, managing the global sales and marketing units and the integration of the business into the wider DXC Technology organisation.<br />Jason&rsquo;s experience spans across North America, Asia as well as Europe, where he built and managed high performing international teams, launching new products to new territories in the trading technology and market data arenas.</p>\r\n</body>\r\n</html>','2019-07-03 13:18:18',6,'1','Jason_Mochine','https://www.koine.com/images/uploads/team/Jason_Mochine1.jpg','Mochine'),(9,'https://www.koine.com/images/uploads/team/Francesco_Roda.png','Francesco','Chief Risk Officer','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Francesco has over 20 years&rsquo; experience in financial services, spanning risk, treasury management and new business development in both large global organisations and start-ups.<br />He co-founded and held the position of Treasurer of Starling Bank, a successful challenger of banks in the UK, where he developed key regulatory documentation for liquidity, market, and operational risk (ICAAP and ILAAP) in support of the application to the PRA and FCA for a banking licence, while maintaining relationships with regulators.<br />Prior to this, Francesco held a variety of senior positions in risk management and audit functions, including HSBC and KPMG across Europe. An early advocate of the opportunities blockchain offers, Francesco worked on a number of leading projects for the tokenisation of value in the fund management and insurance space.</p>\r\n</body>\r\n</html>','2019-07-03 13:20:01',7,'1','Francesco_Roda','https://www.koine.com/images/uploads/team/Francesco_Roda1.jpg','Roda'),(10,'https://www.koine.com/images/uploads/team/Matt_Dangerfield.png','Matt','Chief Technology Officer','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Former CTO, Fixnetix, Cobalt. Established first private blockchain infrastructure for capital markets. Built &amp; ran market-critical infrastructure. Advisor to Crypto-exchanges.</p>\r\n</body>\r\n</html>','2019-07-03 13:21:12',8,'1','Matt_Dangerfield','https://www.koine.com/images/uploads/team/Matt_Dangerfield1.jpg','Dangerfield'),(11,'https://www.koine.com/images/uploads/team/steve.reeves.png','Steve','Chief Financial Officer','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Steven is a Chartered Accountant with over 30 years&rsquo; experience of senior management roles within the financial services sector.<br />He has held senior positions at firms including AxiCorp, Interactive Brokers, ODL Group, City Index and Merrill Lynch.<br />Steven has had extensive exposure to regulatory issues both in UK and overseas and multiple approved person roles with the FCA, material participation in corporate transactions and Stock Exchange Full Listing experience at director level.</p>\r\n</body>\r\n</html>','2019-07-03 13:28:55',9,'1','Steve_Reeves','https://www.koine.com/images/uploads/team/steve.reeves1.jpg','Reeves'),(12,'https://www.koine.com/images/uploads/team/david_grocott.png','David','Chief Information Officer','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Former European Head of Connectivity, Global Markets, Deutsche Bank &amp; former Interim COO, Cobalt DLL.</p>\r\n</body>\r\n</html>','2019-07-03 13:33:07',10,'1','David_Grocott','https://www.koine.com/images/uploads/team/david_grocott1.jpg','Grocott'),(13,'https://www.koine.com/images/uploads/team/paula_medcalf.png','Paula','Head of HR','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>&nbsp;</p>\r\n<p>Paula is a Chartered Member of the Chartered Institute of Personnel and Development (MCIPD) who has worked in human resources across the financial services sector for over 25 years. <br />With a background in project management, Paula has advised and held many management roles at world-class technology and telecommunications businesses, including Misys and Fixnetix (now DXC Technology).<br />She is also a Non-Executive Director to a private company that provides consultancy services in compliance, regulation and risk management, primarily to the financial services market.<br />People-focused, Paula leverages the synergy between the business and HR solutions to enable a business to thrive with an empowered talent pool.</p>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>','2019-07-03 13:46:06',11,'1','Paula_Medcalf','https://www.koine.com/images/uploads/team/paula_medcalf1.jpg','Medcalf'),(14,'https://www.koine.com/images/uploads/team/dan_petrocvic.png','Dan','Sales Director','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Dan focuses on buy side relationships. He brings 24 years of experience in sales and management roles in financial services and technology businesses. Previously worked at SEI Investments, Options, Bell Microproducts (Acquired by Avnet ). Dan is also a member of the board of Trustees for Help for Children UK and is co-chair of the Grant making committee in the UK.</p>\r\n</body>\r\n</html>','2019-07-03 13:47:40',12,'1','Dan_Petrovic','https://www.koine.com/images/uploads/team/dan_petrocvic1.jpg','Petrovic'),(15,'https://www.koine.com/images/uploads/team/saverio_cianfrone.png','Saverio','Sales Director','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Commercial executive with over 10 years&rsquo; experience in Tech between Apple, responsible for iPod Business Development EMEIA / iPod Market Intelligence Worldwide, and the startup scene, early stage and VC backed startups advisor. Extensive experience in strategy, product, business development and sales.</p>\r\n</body>\r\n</html>','2019-07-03 13:49:48',13,'1','Saverio_Cianfrone','https://www.koine.com/images/uploads/team/saverio_cianfrone1.jpg','Cianfrone'),(16,'https://www.koine.com/images/uploads/team/simon_leifer.png','Simon','General Counsel','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>&nbsp;</p>\r\n<p>Simon is a highly experienced, English qualified solicitor.<br />Prior to joining Koine, Simon was a partner in a legal data management consultancy, as well as a consultant in the payment services industry. <br />He was also the Co-Head of the Trading, Derivatives &amp; Securities Financing Legal Team at Dresdner Kleinwort. Simon has worked both in-house and in private practice, as part of a small unit and as a manager of large organisations. <br />He has contributed to many publications, including the legal chapter of Paul Harding\'s \'Mastering the ISDA Master\', published by The Financial Times.</p>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>','2019-07-03 13:51:13',14,'1','Simon_Leifer','https://www.koine.com/images/uploads/team/simon_leifer1.jpg','Leifer'),(17,'https://www.koine.com/images/uploads/team/catherine_obrien.png','Catherine','Management Accountant','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Catherine has over 5 years accounting experience in the FinTech sector.<br />Qualified with Association of Accounting Technicians, Catherine is currently undertaking training to become a Chartered Accountant.</p>\r\n</body>\r\n</html>','2019-07-03 13:52:09',15,'1','Catherine_OÃ¢â‚¬Brien','https://www.koine.com/images/uploads/team/catherine_obrien1.jpg','OÃ¢â‚¬Brien'),(18,'https://www.koine.com/images/uploads/team/russell_ford.png','Russell','DPO & Head of Op Risk','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><span style=\"display: inline !important; float: none; background-color: #ffffff; color: #000000; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">Russell is a qualified Chartered Accountant with over 25 years risk management and internal audit experience within wealth management, private banking and securities services at major banks and institutions.</span><br style=\"color: #000000; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><span style=\"display: inline !important; float: none; background-color: #ffffff; color: #000000; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">His previous roles held include Global Head of Operational Risk for HSBC Securities Services and European Head of Operational Risk at State Street. Russell was also the global internal audit lead at HSBC for their Securities Services and Asset Management businesses and has held other senior roles at Royal Bank of Scotland.</span><br style=\"color: #000000; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><span style=\"display: inline !important; float: none; background-color: #ffffff; color: #000000; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">In addition to his role of Head of Operational Risk, Russell is Koine&rsquo;s Data Protection Officer (DPO).</span></p>\r\n</body>\r\n</html>','2019-07-03 13:53:44',16,'1','Russell_Ford','https://www.koine.com/images/uploads/team/russell_ford.jpg','Ford'),(19,'https://www.koine.com/images/uploads/team/ken_allan.png','Ken','Independent Non-Exec Director','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Former Global Lead Partner EY (Ernst &amp; Young) Cybersecurity practice. Former Global Lead Cybersecurity Partner, PA Consulting. Cybersecurity Advisor NATS (UK National Air Traffic Services) board. Cybersecurity Advisor to GSK CISO Office.</p>\r\n</body>\r\n</html>','2019-07-04 08:59:33',1,'2','Ken_Allan','https://www.koine.com/images/uploads/team/ken_allan1.jpg','Allan'),(20,'https://www.koine.com/images/uploads/team/michael_chambers.png','Michael','INED, Chair of Audit & Compliance','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Former Chief Executive of BACS (UK payments service). Previously at Barclays working in Payments.</p>\r\n</body>\r\n</html>','2019-07-04 09:10:11',2,'2','Michael_Chambers','https://www.koine.com/images/uploads/team/michael_chambers1.jpg','Chambers'),(21,'https://www.koine.com/images/uploads/team/john_wisbey.png','John','Independent Non-Exec Director, Chair of Risk Committee','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Founder and former CEO of Lombard Risk. Former Head of Derivatives at Kleinwort Benson.</p>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>','2019-07-04 09:11:14',3,'2','John_Wisbey','https://www.koine.com/images/uploads/team/john_wisbey1.jpg','Wisbey'),(22,'https://www.koine.com/images/uploads/team/steve_betteridge.png','Steve','INED, Chair of NORICO','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Former Interim COO of Banking Services at Bank of England. Formerly Head of Payments Operations at Lloyds Banking Group.</p>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>','2019-07-04 09:12:36',4,'2','Steve_Betteridge','https://www.koine.com/images/uploads/team/steve_betteridge1.jpg','Betteridge'),(23,'https://www.koine.com/images/uploads/team/serafino_manca_diamond.png','Serafino','Head of Marketing Operations','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p class=\"MsoNormal\">Serafino is an award-winning, senior marketing and communications professional.<br />His experience covers branding, digital presence and integration, marketing and advertising assets building (both print and digital), strategic planning and budgeting, reputation management and positioning, market share expansion and conference/event management.<br />Serafino has worked throughout Europe across a range of industries, managing and co-ordinating the marketing and PR functions.<br />He is a Liveryman of the Worshipful Livery Company of Marketors, Member of the Chartered Institute of Marketing and Member of the Italian Chamber of Commerce for the UK.</p>\r\n</body>\r\n</html>','2019-11-29 11:15:13',17,'1','Serafino_Manca','https://www.koine.com/images/uploads/team/Serafino_Manca.jpg','Manca');
