INSERT INTO `what_we_do` VALUES (1,'Custody of Digital Assets','<p>Segregated custody of digital assets for institutional clients.</p>\r\n<p>Our clients can hold digital assets securely for the long term or, for those who need short-term secure storage combined with access and liquidity, we integrate with the leading exchanges and OTC trading venues to enable safe, efficient trading and real-time settlement.</p>','2019-07-01 12:26:15','https://www.koine.com/images/uploads/icons/custody-of-drypto.png'),(2,'Real-time Settlement','<p>We provide millisecond settlement within our eco-system of partner exchanges and brokers. Our service significantly reduces counter-party and settlement risks for fiat and digital asset trading and, with legal segregation of our client&rsquo;s assets, minimises any insolvency risks. Our solution provides real time settlement in multiple fiat and digital currencies.</p>','2019-07-01 12:39:16','https://www.koine.com/images/uploads/icons/settlement-payment-white.png'),(3,'Fiat and Digital','<p>Independent of our secure custody of digital assets, Koine holds deposits of fiat currency in segregated client accounts with one of the world&rsquo;s leading financial institutions. Koine operates an integrated payment system to enable Swift payments globally for fiat currencies.</p>','2019-07-01 12:39:53','https://www.koine.com/images/uploads/icons/doposits.png'),(4,'Online Access & API Connectivity','<p>Clients can track their settlement transactions and custody positions through Koine&rsquo;s sophisticated online platform or by use of Koine&rsquo;s proprietary and secure APIs to pull specific transaction and position data into their own system platforms.</p>','2019-07-01 12:39:55','https://www.koine.com/images/uploads/icons/transaction-service-white.png');
/*!40000 ALTER TABLE `what_we_do` ENABLE KEYS */;
