INSERT INTO `who_we_serve` VALUES (1,'Trading Venues','<p>Increase trade flows, attract more institutional clients, improve capital efficiency &amp;amp; enterprise value whilst reducing the cost of custody and the risk involved in custody and settlement.</p>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h6><strong>Increase Exchange revenues and liquidity</strong></h6>\r\n<ul>\r\n<li>Bringing you new clients with substantial funds.</li>\r\n<li>Facilitating greater trading volumes with our real time DvP settlement service for multiple fiat and digital assets.</li>\r\n</ul>\r\n<h6><strong>Increase Exchange attractiveness to institutional capital</strong></h6>\r\n<ul>\r\n<li>Funds can maintain their current approach with regard to mandates, governance and codes of conduct.</li>\r\n</ul>\r\n<h6><strong>Delivering value quickly and building for growth</strong></h6>\r\n<ul>\r\n<li>Technical integration through our Binary FIX API in a few days.</li>\r\n<li>Koine&rsquo;s bank-style integration gives you full visibility and control of your accounts and your clients&rsquo; trading accounts.</li>\r\n<li>Option to use Koine as your custodian: to deliver the separation of duties principal preferred by regulators; to de-risk your business; and to de-risk your banking relationships.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>','2019-07-02 07:54:18','Custody & Settlement for Fiat & Digital Assets'),(2,'Funds & Institutional Investors','<p>Secure, bank grade infrastructure and governance providing a true separation of duties for the custody and settlement of digital assets.</p>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><strong>Meets the conventions of institutional fund management</strong></p>\r\n<ul>\r\n<li>Conforms to separation of duties principal.</li>\r\n<li>End to end legal ownership of assets through trading activity.</li>\r\n<li>Minimises counterparty risk (venue and settlement).</li>\r\n<li>Full insolvency protection.</li>\r\n<li>Insurance covers value-at-risk.</li>\r\n</ul>\r\n<p><strong>Flexibility on where you trade</strong></p>\r\n<ul>\r\n<li>OTC desks, peer-to-peer, and exchange venues deliver 24/365 hours trading.</li>\r\n<li>Real-time allocation of assets between market venues pre-trade.</li>\r\n<li>Real-time settlement using DvP with post-trade risk analysis.</li>\r\n</ul>\r\n<p><strong>Flexibility on how you trade</strong></p>\r\n<ul>\r\n<li>Wide range of fiat and crypto-currencies.</li>\r\n<li>Powerful desktop GUI and Binary Fix API access.</li>\r\n</ul>\r\n</body>\r\n</html>','2019-07-02 08:23:56','Custody & Settlement for Funds Managers'),(3,'Digital Issuers','<p>Custody, settlement and partnership services for institutional platforms and issuers of digital securities. Koine is part of a global network of partners for the full project lifecycle of your new digital security issuance.&nbsp;</p>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><strong>Meets the conventions of institutional fund management</strong></p>\r\n<ul>\r\n<li>Conforms to separation of duties principal.</li>\r\n<li>End to end legal ownership of assets through issuance process.</li>\r\n<li>Minimises counterparty risk and provides insolvency protection.</li>\r\n</ul>\r\n<p><strong>From issuance to trade </strong></p>\r\n<ul>\r\n<li>Post-issuance custody in fiat and digital assets facilitates immediate trading with access to multiple OTC desks and exchanges.</li>\r\n</ul>\r\n<p><strong>Full solution for successful issuance</strong></p>\r\n<ul>\r\n<li>Institutional capital already on-boarded and ready to invest.</li>\r\n<li>On-boarding/KYC service for new Brokers and institutional capital.</li>\r\n<li>Funds accepted into escrow in several crypto and fiat currencies then held under CASS 6/7 rules.</li>\r\n<li>Full visibility of committed funds through our portal.</li>\r\n<li>Real-time issuance using DvP solution.</li>\r\n</ul>\r\n</body>\r\n</html>','2019-07-02 08:32:45','Custody, Settlement and Partnership Support for Digital IssuersÃ¢â‚¬'),(4,'Market Infrastructure Providers','<p>Koine supports securities lending, collateral management, service platforms and other custodians and third party agents who wish to engage with the digital asset class.</p>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Conforms to separation of duties principle. <br />End to end legal ownership of assets through trading activity. <br />Eliminates risks of trading bearer instruments.<br />Elimination of counter-party risks (venue and settlement).<br />Nav reporting in near real time. <br />Full insolvency protection / insurance.</p>\r\n<p><strong>Low cost, highly secure long term storage</strong></p>\r\n<p><strong>Term deposits with instant access option</strong></p>\r\n<p><strong>Move funds to where you want to trade at any time</strong>&nbsp;<br />Near real-time transfer of assets between market venues</p>\r\n<p><strong> Flexible on how you trade</strong><br />Multiple venues to select from, supporting 24hrs/Day trading</p>\r\n<p><strong>No limits to your trading activity</strong>&nbsp;<br />24 hours non-stop operations with no volume or value limits.</p>\r\n<p><strong>Exploit price arbitrage opportunities.</strong> <br />Near real-time transfer of assets and fiat between market venues</p>\r\n<p><strong>Redeploy your capital quickly</strong></p>\r\n</body>\r\n</html>','2019-07-02 08:35:24','Meets the standard of conventional fund mandates.');
