INSERT INTO `why_koine` VALUES (1,'Our Governance','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>The governance of Koine reflects its position as a new institutional, regulated custodian of digital assets.</p>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>The governance of Koine reflects its position as a new institutional, regulated custodian of digital assets.</p>\r\n<ul>\r\n<li>Highly respected and experienced board of directors &amp; INEDs</li>\r\n<li>Chairman &amp; CEO with outstanding record of success in the financial and technology sectors.</li>\r\n<li>Risk, Audit and Remuneration committees in place</li>\r\n<li>Money Laundering Reporting Officer in place</li>\r\n<li>KYC / AML / CTF policies and procedures fully implemented</li>\r\n<li>Three Lines of Defence (3LoD) concept fully implemented</li>\r\n<li>Grant Thornton as financial auditor</li>\r\n<li>BDO as controls and internal auditor</li>\r\n<li>Bank of New York Mellon as principal banker</li>\r\n<li>Regulated in UK by FCA, with further jurisdiction applications in process</li>\r\n</ul>\r\n</body>\r\n</html>','2019-07-02 14:09:05','https://www.koine.com/images/uploads/governance.png','https://www.koine.com/images/uploads/governance.png'),(2,'Our Principles, Standards & Processes','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Koine is a new, innovative, regulated institution, specialising in custody and settlement of digital assets, governed and managed to the highest level of control, compliance and security.</p>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Koine is a new, innovative, regulated institution, specialising in custody and settlement of digital assets, and is governed and managed to the highest level of control, compliance and security.</p>\r\n<p>Koine has implemented a full institutional operational risk management framework</p>\r\n<ul>\r\n<li>No risk of loss arising from failure of an exchange or OTC desk.</li>\r\n<li>No humans involved in handling value through trading processes.</li>\r\n<li>Privacy of client trading activity.</li>\r\n<li>Transparency of assets in vaults and on our ledgers.</li>\r\n<li>Minimised handling of bearer instruments.</li>\r\n<li>Continuous monitoring for suspicious trading activity.</li>\r\n</ul>\r\n</body>\r\n</html>','2019-07-02 14:11:51','https://www.koine.com/images/uploads/standard.png','https://www.koine.com/images/uploads/standard.png'),(3,'Our teams are expert and proven','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><span style=\"color: #212529; font-family: koinefinance; font-size: 14.4px; background-color: #ffffff;\">Koine comprises a perfect combination of bankers, technologists and proven business builders.</span></p>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Koine comprises a perfect combination of bankers, technologists and proven business builders.</p>\r\n<ul>\r\n<li>Our team includes financial institution executive leaders, compliance and risk management experts, regulatory specialists, product visionaries, software architects &amp; programmers, cyber-security experts, low-latency network, database &amp; computing infrastructure engineers, custody &amp; settlement operations professionals, financial controllers, marketing &amp; sales professionals and proven entrepreneurs</li>\r\n<li>We are recognised thought leaders on the forthcoming digitalisation of value.</li>\r\n<li>We know our niche &ndash; custody &amp; settlement of digital assets. We are focussed and expert.</li>\r\n</ul>\r\n</body>\r\n</html>','2019-07-03 08:08:07','https://www.koine.com/images/uploads/icons/expert.png','https://www.koine.com/images/uploads/icons/expert.png'),(4,'Capital Efficiency with Lower Risk','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><span style=\"color: #212529; font-family: koinefinance; font-size: 14.4px; background-color: #ffffff;\">Continue to trade digital assets without removal from secure custody.</span></p>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Continue to trade digital assets without removal from secure custody</p>\r\n<p>Our real-time post-trade processes maximise the efficiency of capital and minimize settlement, counterparty and compliance risks</p>\r\n<ul>\r\n<li>Our real-time settlement maximises the market position opportunities for capital</li>\r\n<li>KOINE has created intuitive, lean business processes to support the safe and rapid ingress and discharge of digital assets to and from our ultra-secure digital vaults.</li>\r\n<li>Verify your assets under custody, 24/7, through KOINE&rsquo;s secure Custody Portal.</li>\r\n<li>The post-trade costs of settlement of digital assets by KOINE are very substantially lower than the post-trade costs to settle traditional securities transactions.</li>\r\n<li>KOINE provides the settlement &amp; custody of digital assets to several top trading venues.</li>\r\n<li>Digital assets held in KOINE custody are tradable on our partner trading venues without removal from KOINE secure custody. This lowers credit risk, lowers operational risk, lowers settlement risk and significantly lowers post-trade processing costs.</li>\r\n</ul>\r\n</body>\r\n</html>','2019-07-03 08:30:04','https://www.koine.com/images/uploads/icons/leaders.png','https://www.koine.com/images/uploads/icons/leaders.png'),(5,'Fraud & collusion are prevented','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><span style=\"color: #212529; font-family: koinefinance; font-size: 14.4px; background-color: #ffffff;\">The Koine architecture prevents any party (internal or external) from colluding to defraud assets.</span></p>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>The Koine architecture prevents any party (internal or external) from colluding to defraud assets.</p>\r\n<ul>\r\n<li>Digital assets are held in segregated client accounts, in line with FCA CASS rules.</li>\r\n<li>Fiat assets are deposited with leading our correspondent banks, who are Tier 1 global financial institutions.</li>\r\n<li>Settlement Instructions are constantly monitored. Changes are subject to strict controls and multi-layered encrypted authentications.</li>\r\n<li>The Koine firebreak business processes and technical architecture prevents any party (internal or external) from colluding to defraud assets. Furthermore, the founders, executives and shareholders of Koine have no security clearance to view assets under custody and have no operational access to Koine&rsquo;s ultra-secure platform.</li>\r\n</ul>\r\n</body>\r\n</html>','2019-07-03 08:30:58','https://www.koine.com/images/uploads/icons/Fraud.png','https://www.koine.com/images/uploads/icons/Fraud.png'),(6,'We are Thought Leaders','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><span style=\"color: #212529; font-family: koinefinance; font-size: 14.4px; background-color: #ffffff;\">Our people speak, write and partake in conference panel discussions worldwide on the topics of digital capital markets, tokenisation of the economy and securing digital wealth.</span></p>\r\n</body>\r\n</html>','<body>\r\n\r\n</body>','2019-07-03 08:31:30','https://www.koine.com/images/uploads/icons/leaders.png','https://www.koine.com/images/uploads/icons/leaders.png'),(7,'Award-winning technology','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Awarded Best New Tech at the Trade Tech FX conference in Miami, February 2019.</p>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Awarded Best New Tech at at the world&rsquo;s largest Foreign Exchange (FX) technology conference, Trade Tech FX, in Miami, February 2019. Our co-founder, Phil Mochan, accepted the award.</p>\r\n<p>This award re-inforces that our technology has potential for FX &amp; money markets on top of our core of capital markets, derivatives and tokenised digital assets.</p>\r\n<p>It is wonderful to receive such early market recognition of our potential.</p>\r\n</body>\r\n</html>','2019-07-03 08:37:57','https://www.koine.com/images/uploads/icons/assets.png','https://www.koine.com/images/uploads/icons/assets.png'),(8,'We embrace regulatory oversight','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Koine operates from the UK as a regulated service provider. We are actively seeking further license approvals in the UK, EU and US.</p>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Koine operates from the UK as a regulated service provider, and adhers to the highest standards of regulatory compliance.</p>\r\n<ul>\r\n<li>KOINE performs full KYC/AML/CTF on clients and clean-source checks on assets</li>\r\n<li>Koine Finance Ltd is an EMD Agent of PayrNet Limited, an Electronic Money Institution authorised by the Financial Conduct Authority under the Electronic Money Regulations 2011 (FCA reference number 900594). Koine&rsquo;s FCA reference number is 902023</li>\r\n<li>KOINE is actively seeking further license approvals in the UK, EU and US.</li>\r\n</ul>\r\n</body>\r\n</html>','2019-07-03 08:39:40','https://www.koine.com/images/uploads/icons/regulatory.png','https://www.koine.com/images/uploads/icons/regulatory.png'),(9,'Security is EAL7+ military standard','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Messaging across our proprietary network is secured by military-grade firewalls and network diode technologies.</p>\r\n</body>\r\n</html>','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Messaging across our proprietary network is secured by military-grade firewalls and network diode technologies.</p>\r\n<ul>\r\n<li>The Koine digital vault integrates EAL7+ certified components and FIPS 140-2 HSMs</li>\r\n<li>Best-in-class Hardware Security Modules (&ldquo;HSM&rdquo;) are distributed across our data centres to allow private keys to be generated automatically, encrypted immediately and never exposed.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>','2019-07-03 08:41:36','/images/uploads/icons/standard.png','/images/uploads/icons/standard.png');
